def create_proteins(data):
    proteins = {
        refseq_nm: Protein(refseq=refseq_nm, sequence=sequence)
        for refseq_nm, sequence in data.items()
    }
    db.session.add_all(proteins.values())
    db.session.commit()
    return proteins


